In 1976, Paul McCartney and Wings undertook an epic world 
tour which brought their music to a live audience of two million 
people in ten countries, an experience captured on the Wings 
over America triple album. The climax of that tour was an 
incredible performance at the mammoth Kingdome in Seattle, 
Washington, where a staggering 67,000 fans listened to Wings 
perform their greatest songs.

Fully restored and remastered from the original film and audio 
masters, this is Wings at their best - live on stage in a 
concert that was destined to live forever.

